INSERT INTO `entrust_roles` VALUES ('1', 'atm', 'Air Traffic Manager', 'ARTCC Air Traffic Manager', 'The Air Traffic Manager is responsible to the VATUSA Southern Region Director for the overall administration of the ARTCC. The ATM is responsible for appointing ARTCC staff members and delegation of authorities.', 'atm@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 20:59:26');
INSERT INTO `entrust_roles` VALUES ('2', 'datm', 'Deputy Air Traffic Manager', 'ARTCC Deputy Air Traffic Manager', 'The Deputy Air Traffic Manager reports to the Air Traffic Manager and acts as Air Traffic Manager in their absence. The Deputy Air Traffic Manager is jointly responsible for administration and accuracy of the roster including visiting controllers.', 'datm@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:01');
INSERT INTO `entrust_roles` VALUES ('3', 'ta', 'Training Administrator', 'ARTCC Training Administrator', 'The Training Administrator works with the Air Traffic Manager and Deputy Air Traffic Manager to build training programmes, establish training procedures and recommend instructors and mentors. The Training Administrator works with Instructors and Mentors to develop knowledge and mentors to help develop teaching ability.', 'ta@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:04');
INSERT INTO `entrust_roles` VALUES ('4', 'ec', 'Events Coordinator', 'ARTCC Events Coordinator', 'The Events Coordinator is responsible to the Deputy Air Traffic Manager for the coordination, planning, dissemination and creation of events to neighboring facilities, virtual airlines, VATUSA and VATSIM.', 'events@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:14');
INSERT INTO `entrust_roles` VALUES ('5', 'fe', 'Facility Engineer', 'ARTCC Facility Engineer', 'The Facility Engineer is responsible to the Senior Staff for creation of sector files, radar client files, training scenarios, Letters of Agreement, Memorandums of Understanding, Standard Operating Procedures and other requests as directed and submission to the Air Traffic Manager for approval prior to dissemination.', 'fe@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:16');
INSERT INTO `entrust_roles` VALUES ('6', 'wm', 'Webmaster', 'ARTCC Webmaster', 'Responsible to the Air Traffic Manager for the operation and maintenance of all IT services including, but not limited to, the Website, Teamspeak and Email services and any other tasking as directed.', 'webmaster@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:20');
INSERT INTO `entrust_roles` VALUES ('7', 'ata', 'Assistant Training Administrator', 'ARTCC Assistant Training Administrator', 'The Assistant Training Administrator is appointed by the Training Administrator and approved by the Air Traffic Manager. The Assistant Training Administrator assists the Training Administrator in development and execution of training programmes, selection of Instructors and Mentors and other tasks as directed.', 'ata@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:23');
INSERT INTO `entrust_roles` VALUES ('8', 'aec', 'Assistant Events Coordinator', 'ARTCC Assistant Events Coordinator', 'The Assistant Events Coordinator is responsible to the Events Coordination for assistance in coordination, planning, dissemination and creation of events to neighboring facilities, virtual airlines, VATUSA and VATSIM and other tasking as directed.', 'events@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:27');
INSERT INTO `entrust_roles` VALUES ('9', 'awm', 'Assistant Webmaster', 'ARTCC Assistant Webmaster', 'The Assistant Webmaster is appointed by the Webmaster and approved by the Air Traffic Manager. The Assistant Webmaster assists the Webmaster in development and management of IT services.', 'awm@zjxartcc.org', '0', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:30');
INSERT INTO `entrust_roles` VALUES ('10', 'ins', 'Instructor', 'ARTCC Instructor', 'Administers and assesses position certification practical exams, rating-promotion practical exams. Assigns written tests to students.', 'ins@zjxartcc.org', '1', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:37');
INSERT INTO `entrust_roles` VALUES ('11', 'mtr', 'Mentor', 'ARTCC Mentor', 'Monitors, assists, and educates student controllers in air traffic control procedures and ARTCC standard operating procedures.', 'mtr@zjxartcc.org', '1', '1', '2017-05-29 12:49:23', '2017-05-29 21:00:42');
