INSERT INTO `system_settings` VALUES ('1', 'ZJX', 'SGRMyV3dV1h6qdIt', 'ef9SEgwK6Z0bCDPp', 'http://www.weather.unisys.com/radar/wrad_se.gif', 'http://www.weather.unisys.com/satellite/sat_vis_se_loop-12.gif', 'http://www.weather.unisys.com/satellite/sat_ir_enh_se_loop-12.gif', 'http://weather.unisys.com/surface/sfc_se.gif', '<p><span style=\"font-size: 14px;\">Welcome to the Jacksonville ARTCC website. This website is for a group of online hobbyists who partake in simulated flying and air traffic control on the VATSIM network. The Jacksonville ARTCC owns a large chunk of airspace spanning from the Pensacola Naval Air Station complex, to Jacksonville International airport; Charleston Air Force Base/International Airport, down to Orlando International airport. The procedures we use mirror, to an extent, those utilized by real world air traffic control. </span></p><p><span style=\"font-size: 14px;\"><b>At no time, however, should a procedure, chart, or other information contained on this website be used for real world navigation.</b></span></p>');
